      final categoryName = category.key;
      final places = category.value;

      final collectionRef = firestore.collection('preferences').doc(categoryName).collection('places');

      for (var place in places) {
        await collectionRef.add({
          'name': place['name'],
          'image': place['image'],
        });
      }
    }

